import React, { useRef, useEffect } from "react";

// import material-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box } from "@material-ui/core";

// import react-magicscroll
import { Controller, Scene } from "react-scrollmagic";
import { Tween, Timeline } from "react-gsap";
import { Back } from 'gsap/EasePack';

// custom css styling
const useStyles = makeStyles({
  panel1: {
    height: "100vh",
    background: "green"
  }
});

function Contact() {
  const classes = useStyles();

  return (
    <>
      <Box display="flex" justifyContent="center" id="contact">
        <h1 style={{ fontSize: "50px" }}>Get in Touch</h1>
      </Box>

      <div className="section" />
      <Controller>
        <Scene duration={300} offset={300} pin>
          <Tween
            wrapper={<ul className="devs" />}
            staggerFrom={{
              opacity: 0,
              cycle: {
                rotationX: [-90, 90],
                transformOrigin: ["50% top -100", "50% bottom 100"]
              }
            }}
            stagger={0.1}
          >
            <li>Rich Harris</li>
            <li>Dan Abramov</li>
            <li>Kyle Simpson</li>
            <li>Gregory Brown</li>
            <li>Addy Osmani</li>
            <li>Evan You</li>
            <li>Axel Rauschmayer</li>
            <li>Sarah Drasner</li>
            <li>André Staltz</li>
          </Tween>
        </Scene>
        <div className="section" />
        <Scene duration={300} offset={300} pin>
          <Tween
            wrapper={<ul className="devs2" />}
            staggerFrom={{
              opacity: 0,
              cycle: {
                x: i => (i + 1) * 50
              },
              ease: Back.easeOut
            }}
            stagger={0.1}
          >
            <li>Rich Harris</li>
            <li>Dan Abramov</li>
            <li>Kyle Simpson</li>
            <li>Gregory Brown</li>
            <li>Addy Osmani</li>
            <li>Evan You</li>
            <li>Axel Rauschmayer</li>
            <li>Sarah Drasner</li>
            <li>André Staltz</li>
          </Tween>
        </Scene>
      </Controller>
      <div className="section" />
    </>
  );
}

export default Contact;
